        res.render();
    } catch (error) {
        return next(error);
    }
});

router.get('/signUp', asyncHandler(async (req, res, next) => {
    const successfullResult = await signUp;
    res.render();
}));

router.get('/product', async (req, res, next) => {
    try {
        const successfullResult = await products;
        res.render()
    } catch (error) {
        return next(error)
    }
});

module.exports = { router }

